import React from 'react'
import ReactApexChart from 'react-apexcharts'

function Chart4() {

    const series= [33,33,34],
            options= {
              chart: {
                type: 'donut',
              },
              chartOptions: {
                labels: ['Apple', 'Mango', 'Orange']
              },
              responsive: [{
                breakpoint: 480,
                options: {
                  chart: {
                    width: 200
                  },

                  legend: {
                    position: 'bottom'
                  }
                }
              }]
            }

    return (
        <div>
            <ReactApexChart options={options} series={series} type="donut" />
        </div>
    )
}

export default Chart4
